import 'dart:io';import 'package:flutter/material.dart';import 'package:flutter_driver/flutter_driver.dart';import 'package:test/test.dart';import 'rembo/screen_home_rempo.dart';import 'rembo/screen_tow_rempo.dart';void main(){  group("end to end tests", (){    HomeRobot ?homeRobot;    ScreenTowRobot?screenTowRobot;    FlutterDriver ?driver;    setUpAll(() async {      driver = await FlutterDriver.connect();      await driver!.waitUntilFirstFrameRasterized();      screenTowRobot=ScreenTowRobot(driver!);      homeRobot=HomeRobot(driver!);    });    test('check flutter driver health', () async {      final health = await driver!.checkHealth();      expect(health.status, HealthStatus.ok);    });    test("found title login page", () async {      sleep(const Duration(seconds: 2));      homeRobot!.findTitle();    });    test("form login", () async {      final SerializableFinder userText = find.byValueKey('userText');      await driver!.enterText('test@test.com',);      await driver!.waitFor(find.text('test@test.com'));      final SerializableFinder passText = find.byValueKey('passText');      await driver!.enterText('password',);      await driver!.waitForAbsent(find.text('password'));      // Ensure there is a login and password field on the initial page      // Enter text      sleep(const Duration(seconds: 2));    });    test("found buttom and click", () async {      homeRobot!.clickFirstButton();    });    test("check title screen2", () async {      screenTowRobot!.findTitle();    });    test("check title screen2", () async {      screenTowRobot!.clickbackButton();    });    test("check text sucess login screen1", () async {      homeRobot!.findLginSucess();    });    test("button confirmar", () async {      SerializableFinder fab = find.byValueKey('confirmar');      await driver!.tap(fab);      //driver.tap(find.byValueKey("ButtonJaCadastro"));      // await driver.tap(toque);    });    tearDownAll(() async {      if(driver != null){        driver!.close();      }    });  });}